import { Component } from 'react';

import shareScreen from "../../pictures/sharescreen.png";
import stopShare from "../../pictures/stopshare.png";




class Page13 extends Component {

    state = {
        text: {}
    }
    
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
    }
  
    render() {
        return (
            <div className="sheet">
                <div id="page13" className="left">
                    <h1 id="p13title" className="bold center">Sharing about mentoring</h1>
                    <div className='container_for_medium_margin'>
                        <p>
                            You have the option of sharing information about what we did in mentoring with someone who supports you. <br/><br/>
                            Do you think you want to do that this week? It’s your choice if you would like to share about what you’re learning, or not, with someone who you really trust like a family member, teacher, or counselor. If you do want to share, then I’ll have you fill out a short worksheet!  If you don’t want to share, that’s okay too! 
                        </p>
                    </div>

                    <div className='container_for_medium_margin'>
                        <div className="custom_svg demo_box" id="instruction_box_number_1_page_13_sheet_11">
                            <p className="in_inst blue_text">If they want to share, click the link for the worksheet</p>
                        </div>
                    </div>
                    
                    <div className='container_for_large_margin'>
                        <div className="custom_svg demo_box" id="instruction_box_number_2_page_13_sheet_11">
                            <p className="in_inst blue_text">Share your screen</p>
                        </div>
                        <img src={shareScreen} alt="Share your screen" id="share_screen_page_13" />
                    </div>
                    
                    <div className='container_for_extra_large_margin'>
                        <div className="custom_svg demo_box" id="instruction_box_number_3_page_13_sheet_11">
                            <p className="in_inst">When you are finished, stop sharing your screen</p>
                        </div>
                        <img src={stopShare} alt="Stop sharing" id="stop_share_page_13" />
                    </div>
                </div>
            </div>
        )
    }
}
export default Page13;
